Here's a simple programming problem: write a function exp which takes in a natural number (an integer greater than or equal to zero) and returns the quantity 2n. Of course, 2n is just the quantity 2 multiplied by itself n times (e.g. 23 is 2 times 2 times 2), with the edge case of 20=1. Now, if we were asked to solve this problem in an imperative programming language (like Python or C), our first instinct might be to do something like this: int exp (int n) { // requires: n>=0 i = 0; res = 1; while (i<n) { res = res * 2; i = i+1; } return res;
} This code directly solves the problem by "multiplying by 2, n times": it establishes a "result" res, and then repeatedly mutates res by multiplying by 2. The counter i and the loop guard are there to make sure that we do this exactly n times, giving 2n. This is what's called an iterative solution : it consists of initializing our data (in this case, the values stored in res and i), performing a carefully-chosen sequence of mutations to it (doubling res and incrementing i), and then reading off the result (the value in res). It is this style of thinking which plays a central role in imperative programming. Such a solution is not possible when doing functional programming. Indeed, pure functional programming languages (by definition[1]) do not have data "cells" which can be repeatedly modified (as i and res are in the preceding example): everything in a functional programming language is immutable . If i is a "variable" in a functional programming language, i has just one value and will never have a different value. So we must find a different way to solve this problem. Our solution will be to use recursion . The following is a correct SML implementation of exp. Type annotations have been omitted, for clarity. (* exp : int -> int * REQUIRES: n>=0 * ENSURES: exp n == 2^n *)
fun exp 0 = 1 | exp n = 2 * exp(n-1) In the above code, we specify the base case that \( 2^0 = 1 \). Then, for inputs greater than 0, we first compute \(2^{n-1} \) recursively, and then multiply 2 to it. By "recursively", we are assuming our code works for smaller inputs. You can trace through a few test cases to convince yourself that these elegant two lines of code indeed implement exp.
